import React from "react";
import styled from "styled-components";
import { colors } from "./../../colors.js";

export const Note = (props) => {
  return (
    <StyledDiv>
      <span className={"style" + props.tag}>{props.num}</span>
    </StyledDiv>
  );
};

Note.defaultProps = {
  num: 0,
  tag: 0,
};

const StyledDiv = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;

  height: 100%;
  width: 100%;
  color: ${colors.noteNormal};
  font-size: 55%;
  overflow: hidden;

  .style-1 {
    text-decoration: line-through;
    color: ${colors.noteStrike};
  }
  .style0 {
    //visibility: hidden;
    color: transparent;
    animation: fadeOut 1s ease-in-out-out;
    @keyframes fadeOut {
      0% {
        color: ${colors.noteNormal};
      }
      50% {
        color: transparent;
      }
    }
  }
  .style1 {
    font-weight: normal;
  }
  .style2 {
    color: ${colors.noteAccent};
    font-weight: bold;
  }
`;
